import { container, row, col} from 'react-bootstrap'; 
import "bootstrap/dist/css/bootstrap.min.css";
function Bootstrap()  {
    return(
        <div className="Bootstrap"> 
            <container>
              <row>
                <col>1 of 3</col>
                <col xs={6}>2 of 3 (wider)</col>
                <col>3 of 3</col>
              </row>
              <row>
                <col>1 of 3</col>
                <col xs={5}>2 of 3 (wider)</col>
                <col>3 of 3</col>
              </row>
            </container>
            </div> 
          );
        }
           
   
export default Bootstrap;
